
output_format = asc
#table         = 0
teeout        = no
teerunout     = yes
tune          = base

flagsurl=$[top]/config/flags/amd2021_flags.xml 


CC_VERSION_OPTION  = --version
CXX_VERSION_OPTION = --version
FC_VERSION_OPTION  = --version

%if %{model} eq 'omp_target'
  OPTIMIZE += -DSPEC_OPENMP_TARGET
%endif
%if %{model} eq 'omp_inner_simd'
  OPTIMIZE += -DSPEC_OPENMP_INNER_SIMD
%endif
%if %{model} eq 'omp_loop'
  OPTIMIZE += -DSPEC_OPENMP_LOOP
%endif
 
%if %{altmodel} ne ''
  src.alt=%{altmodel}
%  define model 'src.alt'
%else
%  define altmodel 'none'
%endif

label         = %{model}_%{altmodel}_%{gputype}

default:
sw_compiler  = Computer System Compiler C and Fortran90
CC   = clang
FC   = flang
OBJ  = .o
EXTRA_LIBS               = 
EXTRA_FLIBS              = -lm

# portability & libraries
#

# Host execution

550.pmd,551.ppalm,556.psp,559.pmniGhost:
FPPPORTABILITY += -DSPEC_NO_OMP_ALWAYS

557.pcsp:
PORTABILITY += -mcmodel=large 

default=base:
OPTIMIZE += -O3 -fopenmp -DSPEC_ACCEL
OPTIMIZE += -fopenmp-targets=x86_64-pc-linux-gnu -Xopenmp-target=x86_64-pc-linux-gnu 
OPTIMIZE += -march=%{gputype} -fuse-ld=ld
OPTIMIZE += -fsanitize=unsigned-integer-overflow -fsanitize-trap=unsigned-integer-overflow

# target execution
default=peak:
#submit = timeout --foreground 200s $command
OPTIMIZE += -O3 -fopenmp -fuse-ld=ld -DSPEC_ACCEL
OPTIMIZE += -fopenmp-targets=amdgcn-amd-amdhsa -Xopenmp-target=amdgcn-amd-amdhsa -march=%{gputype}
OPTIMIZE += -fopenmp-target-fast
#OPTIMIZE += -v -save-temps

#Attributor bug
557.pcsp:
#OPTIMIZE += -O1

570.pbt:
#OPTIMIZE += -O1

